import React from 'react'
import './HomePage.css'
import logo from '../../logo.svg'

const HomePage = () => {
  const listMenu = [
    {
      title: 'Home',
    },
    {
      title: 'Course',
    },
    {
      title: 'Become a teacher',
    },
    {
      title: 'Account',
    },
  ]
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <div>
          <ul>
            {listMenu.map((post) => <li key={post.id}>
              {post.title}
            </li>)}
          </ul>
        </div>
      </header>

    </div>
  )
}

export default HomePage
